          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: "Possible values are:\n- GNB_ACTIVE_RATIO: Indicates that the network\
        \ performance requirement is gNodeB active (i.e. up and running) rate. Indicates\
        \ the ratio of gNB active (i.e. up and running) number to the total number\
        \ of gNB\n- GNB_COMPUTING_USAGE: Indicates gNodeB computing resource usage.\n\
        - GNB_MEMORY_USAGE: Indicates gNodeB memory usage.\n- GNB_DISK_USAGE: Indicates\
        \ gNodeB disk usage.\n- NUM_OF_UE: Indicates number of UEs.\n- SESS_SUCC_RATIO:\
        \ Indicates ratio of successful setup of PDU sessions to total PDU session\
        \ setup attempts.\n- HO_SUCC_RATIO: Indicates Ratio of successful handovers\
        \ to the total handover attempts. \n"
    ExpectedAnalyticsType:
      anyOf:
